query BlogPostBySlug(
  $slug: String!
) {
  site {
    siteMetadata {
      title
    }
  }
  markdownRemark(fields: {slug: {eq: $slug}}) {
    id
    excerpt(pruneLength: 160)
    html
    fields {
      readingTime {
        text
      }
    }
    frontmatter {
      title
      date(formatString: "MMMM DD, YYYY")
      author
      excerpt
    }
  }
}

